import * as ExcelJS from 'exceljs';
import saveAs from "file-saver";
import { IExcelReportParams } from "../../interfaces/IExcelReportParams";

export const excelExport = async (params: IExcelReportParams) => {
    // create a workbook
    const workbook = new ExcelJS.Workbook();

    // add a worksheet
    const worksheet = workbook.addWorksheet(params.reportName,
        {
            properties: { tabColor: { argb: '177B487B' } },
        });

    // columns
    const columns = params.headerItems

    worksheet.mergeCells("A1:F1");
    worksheet.mergeCells("G1:L1");
    worksheet.getRow(1).height = 70;
    worksheet.getRow(1).alignment = { vertical: 'middle', horizontal: 'center' }


    const customCell = worksheet.getCell("A1");
    customCell.font = {
        name: "Times New Roman",
        family: 4,
        size: 26,
        underline: false,
        bold: true
    };

    if (params.reportName === 'General') {
        customCell.value = 'Reporte ' + params.reportName;

    } else {
        customCell.value = params.reportName;
    }

    // insert logo
    const base64LogoContent = '';
    const logo = workbook.addImage({
        base64: base64LogoContent,
        extension: 'png'
    });



    worksheet.addImage(logo, params.logo);


    if (params.reportName === 'General') {

        worksheet.mergeCells("A2:Y2");
        worksheet.mergeCells("Z2:AH2");
        worksheet.mergeCells("AI2:AU2");
        worksheet.mergeCells("AV2:BK2");
        worksheet.mergeCells("BL2:BZ2");
        worksheet.mergeCells("CA2:CG2");
        worksheet.mergeCells("CH2:CI2");

        worksheet.getRow(2).height = 30;
        worksheet.getRow(2).alignment = { vertical: 'middle', horizontal: 'center' }


        const cellPersonal = worksheet.getCell("A2");
        const cellEducativa = worksheet.getCell("Z2");
        const cellFamiliar = worksheet.getCell("AI2");
        const cellRepresentante = worksheet.getCell("AV2");
        const cellSalud = worksheet.getCell("BL2");
        const cellInscripcion = worksheet.getCell("CA2");
        const cellDesvinculacion = worksheet.getCell("CH2");

        cellPersonal.value = "FICHA PERSONAL";
        cellEducativa.value = "FICHA EDUCATIVA";
        cellFamiliar.value = "FICHA FAMILIAR";
        cellRepresentante.value = "FICHA DE REPRESENTANTE";
        cellSalud.value = "FICHA DE SALUD";
        cellInscripcion.value = "FICHA DE INSCRIPCION";
        cellDesvinculacion.value = "DESVINCULACION";

        worksheet.getRow(2).font = {
            name: "Times New Roman",
            family: 4,
            size: 26,
            underline: false,
            bold: true,

        };

        cellPersonal.fill = {
            type: 'pattern',
            pattern: 'darkTrellis',
            fgColor: { argb: '2D98DA' },
            bgColor: { argb: 'F7F1F1' }
        };

        cellEducativa.fill = {
            type: 'pattern',
            pattern: 'darkTrellis',
            fgColor: { argb: 'A9DFBF' },
            bgColor: { argb: 'F7F1F1' }
        };

        cellFamiliar.fill = {
            type: 'pattern',
            pattern: 'darkTrellis',
            fgColor: { argb: 'F5B7B1' },
            bgColor: { argb: 'F7F1F1' }
        };
        cellRepresentante.fill = {
            type: 'pattern',
            pattern: 'darkTrellis',
            fgColor: { argb: 'F7DC6F' },
            bgColor: { argb: 'F7F1F1' }
        };
        cellSalud.fill = {
            type: 'pattern',
            pattern: 'darkTrellis',
            fgColor: { argb: 'FFA500' },
            bgColor: { argb: 'F7F1F1' }
        };
        cellInscripcion.fill = {
            type: 'pattern',
            pattern: 'darkTrellis',
            fgColor: { argb: 'D7BDE2' },
            bgColor: { argb: 'F7F1F1' }
        };
        cellDesvinculacion.fill = {
            type: 'pattern',
            pattern: 'darkTrellis',
            fgColor: { argb: 'ABEBC6' },
            bgColor: { argb: 'F7F1F1' }
        };

    }


    if (params.reportName === 'General') {
        const headerRow = worksheet.getRow(3);
        headerRow.height = 20;
        headerRow.font = {
            name: "Times New Roman", size: 12,
            bold: true, color: { argb: 'FFFFFFFF' }
        };
        headerRow.alignment = { horizontal: "center", vertical: "middle" }
        headerRow.fill = {
            type: 'pattern',
            pattern: 'solid',
            fgColor: { argb: '871B1B' }

            // fgColor: { argb: 'B0252A' }
        }
        for (let i = 0; i < columns.length; i++) {
            const currentColumnWidth = columns[i].width;
            worksheet.getColumn(i + 1).width = currentColumnWidth !== undefined ? currentColumnWidth : 20;
            const cell = headerRow.getCell(i + 1);
            cell.value = columns[i].header;
        }
        worksheet.autoFilter = {
            from: 'A4',
            to: {
                row: 3,
                column: columns.length
            }
        }

        worksheet.views = [{ state: "frozen", ySplit: 3 }];


    } else {
        const headerRow = worksheet.getRow(2);
        headerRow.height = 20;
        headerRow.font = {
            name: "Times New Roman", size: 12,
            bold: true, color: { argb: 'FFFFFFFF' }
        };
        headerRow.alignment = { horizontal: "center", vertical: "middle" }
        headerRow.fill = {
            type: 'pattern',
            pattern: 'solid',
            fgColor: { argb: '871B1B' }

            // fgColor: { argb: 'B0252A' }
        }
        for (let i = 0; i < columns.length; i++) {
            const currentColumnWidth = columns[i].width;
            worksheet.getColumn(i + 1).width = currentColumnWidth !== undefined ? currentColumnWidth : 20;
            const cell = headerRow.getCell(i + 1);
            cell.value = columns[i].header;
        }
        worksheet.autoFilter = {
            from: 'A4',
            to: {
                row: 2,
                column: columns.length
            }
        }

        worksheet.views = [{ state: "frozen", ySplit: 2 }];

    }



    // insert data
    if (params.reportName === 'Ficha Personal' || params.reportName === 'General') {
        for (let i = 0; i < params.rowData.length; i++) {
            const base64Image = params.rowData[i].foto.replace(/^data:.*,/, "");
            params.rowData[i].foto = '';

            let currentCount = 0;
            if (params.reportName === 'General') {
                currentCount = i + 2
            } else {
                currentCount = i + 1
            }
            const dataRow = worksheet.getRow(2 + currentCount);
            dataRow.outlineLevel = 1;
            dataRow.alignment = { vertical: 'middle', horizontal: 'center' }
            dataRow.values = Object.values(params.rowData[i]);

            dataRow.font = {
                name: "Times New Roman",
                size: 12,

            }
            dataRow.border = {
                top: { style: 'thin', color: { argb: 'B0252A' } },
                // left: { style: 'thin', color: { argb: 'B0252A' } },
                bottom: { style: 'thin', color: { argb: 'B0252A' } },
                // right: { style: 'thin', color: { argb: 'B0252A' } },
            }
            // alert(base64Image)
            const imageId = workbook.addImage({
                base64: base64Image,
                extension: 'jpeg', // Cambia la extensión según el formato de la imagen
            });

            // const position = 'B' + (2 + currentCount) + ':' + 'B' + (2 + currentCount);
            // alert(position)
            // worksheet.addImage(imageId, position);
            worksheet.addImage(imageId, {
                tl: { col: 1.1, row: 1.1 + currentCount }, // top-left cell
                ext: { width: 75, height: 80 }, // image dimensions
            });
            worksheet.getRow(2 + currentCount).height = 62;
            worksheet.getColumn('B').width = 12;
        }

    } else {
        for (let i = 0; i < params.rowData.length; i++) {
            const currentCount = i + 1
            const dataRow = worksheet.getRow(2 + currentCount);
            dataRow.outlineLevel = 1;
            dataRow.alignment = { vertical: 'middle', horizontal: 'center' }
            dataRow.values = Object.values(params.rowData[i]);

            dataRow.font = {
                name: "Times New Roman",
                size: 12,

            }
            dataRow.border = {
                top: { style: 'thin', color: { argb: 'B0252A' } },
                // left: { style: 'thin', color: { argb: 'B0252A' } },
                bottom: { style: 'thin', color: { argb: 'B0252A' } },
                // right: { style: 'thin', color: { argb: 'B0252A' } },
            }
        }
    }



    workbook.xlsx.writeBuffer().then(function (buffer) {
        const fecha = new Date();
        const dia = fecha.getDate().toString().padStart(2, '0'); // Garantiza 2 dígitos con un 0 adelante si es necesario
        const mes = (fecha.getMonth() + 1).toString().padStart(2, '0'); // Garantiza 2 dígitos con un 0 adelante si es necesario
        const anio = fecha.getFullYear();

        const cadena = params.reportName.includes("Asistencia")
            ? `Reporte _ ${params.reportName}`
            : `Reporte _ ${params.reportName} _ ${dia}-${mes}-${anio}`;

        saveAs(
            new Blob([buffer], { type: "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet" }),
            cadena
        )
    })
}
